-- ----------------------------
-- Triggers structure for table transaction_detail
-- ----------------------------
DROP TRIGGER IF EXISTS `T_AFTER_INSERT_TRANSACTION_DETAIL`;
delimiter ;;
CREATE TRIGGER `T_AFTER_INSERT_TRANSACTION_DETAIL` AFTER INSERT ON `transaction_detail` FOR EACH ROW BEGIN
    IF NEW.transaction_type = 'in' THEN
        -- Check if the stock exists
        IF (SELECT stcheck.product_id FROM stocks stcheck WHERE stcheck.user_partner_id = NEW.user_partner_id AND stcheck.product_id = NEW.product_id LIMIT 1) IS NULL THEN
            -- Insert a new stock record if it doesn't exist
            VALUES(
                NEW.user_partner_id, NEW.product_id, 
                (SELECT prd.product_sku FROM products prd WHERE prd.product_id = NEW.product_id LIMIT 1),
                NEW.quantity
            );
        ELSE
            -- Update the stock if it exists
            UPDATE stocks stin 
            SET stin.quantity = (stin.quantity + NEW.quantity)
            WHERE stin.user_partner_id = NEW.user_partner_id AND stin.product_id = NEW.product_id;
        END IF;
    ELSE
        -- Handle 'out' transaction type, update the stock
        UPDATE stocks stin 
        SET stin.quantity = (stin.quantity - NEW.quantity)
        WHERE stin.user_partner_id = NEW.user_partner_id AND stin.product_id = NEW.product_id;
    END IF;
END
;;
delimiter ;

